Позволяет создавать тактические схемы и упражнения для тренировочного процесса. Подходит для организации командной и индивидуальной работы как профессионалов, так и любителей. Все действия имеют условные обозначения. Созданные схемы можно сохранить в специальную папку с возможностью редактирования и дальнейшей печати. 

Приложение позволяет оптимизировать процесс тренировок, учитывая факторы дефицита рабочего времени и финансовых издержек. 
Основные критерии работы: 
- простота и доступность; 
- информативность; 
- визуализация; 
- схематичное обозначение действий. 

У пользователей есть возможность обмениваться созданными схемами и методиками, разделять их по практической направленности (выход из зоны, игра в средней зоне, вход в зону и т.д.), редактировать и сохранять схемы и упражнения. 

Интерфейс приложения настолько прост, что его использование доступно для профессиональных тренеров, тренеров-любителей, профессиональных спортсменов, а также для родителей.
